var _story_ = {
    "1402": [
        {
            "_id": 1,
            "Story": "In that holy city kissed by the dawn, the weaver caresses the golden threads, entwining fates.<br>The Chrysos Heir that bears the \"Romance\" Coreflame gathered the world's heroes, leading them on a long journey once more<br> to topple the gods, reclaim the divine flame, and grant rebirth to the nearly fallen Amphoreus."
        },
        {
            "_id": 2,
            "Story": "Years later, when she unexpectedly discovers a garment she had woven in her youth, tenderness pours from the silk, gently shaking her long-stilled heart.<br><br>In the family devoted to Mnestia throughout the generations, each member is taught a \"beautiful\" art from a young age. Portraits of the great masters hang on the honor wall of the private bath, ever watching over their progeny.<br>While many are left speechless by the intense scrutiny of these masters, she moves with an effortless grace beneath their heavy gaze.<br><i>\"Painting succumbs to pretense, music to abstraction, sculpture to bulkiness, and drama to the mundane...\"</i><br>The elders show clear signs of defeat, but her voice, young and resolute, silences any objections.<br><i>\"Little Agy, surely there is nothing more beautiful than these.\"</i><br>Stepping out of the bath, she dances on tiptoes to the mirror, her pale golden hair cascading like a waterfall.<br><i>\"No.\"</i><br>In the steam-clouded mirror, her golden eyes pull countless strands of attention along <br><i>\"I will find it  the existence that surpasses all others in beauty.\"</i><br><br><i>\"It was for such a simple reason that, later on...\" </i>The warmth of the garment touches her fingertips, awakening memories.<br>She mischievously climbs in the Grove and mused in the baths, all for a golden leaf, a handful of inspirational spray.<br>She dashed across rooftops and paused in meadows, all to weave the freedom of the breeze and the far-off fragrance of flowers into her threads.<br>Time flowed on. The loom never stilled. Her creations spark trends in Okhema, again and again.<br>Dressed in her finest fabric, she visits the temple, yet she still wonders, <i>\"Is this beauty?\"</i><br><br>The priest of Mnestia had reached her twilight years, her eyesight diminished, yet the girl's brilliance still cut through the gloom before her.<br><br><i>\"Little Agy, when you assume the mantle of the 'Goldweaver,' you're destined to craft works that even the gods would envy.\"<br>\"This garment, and you in this garment, are indeed beautiful... yet this isn't 'beauty'.\"<br>\"But... aren't 'beauty' and 'beautiful' the same?\"<br>\"You still don't understand... and not understanding, that's a good thing, truly a good thing...\"</i>"
        },
        {
            "_id": 3,
            "Story": "As time swept by, the garments she designed multiply, as vast as the starry heavens.<br>Yet, curiously, within that grand and ornate wardrobe, many tattered old fabric scraps are carefully preserved.<br><br>On lands rife with conflict, young warriors set out clad in vibrant attire, only to return with their uniform as shrouds  sometimes only scraps of their garb remain. When no one claimed these remnants, she alone collects them.<br>In her fury, she once destroyed lavish garments. The corrupt, pampered nobles did not deserve to parade in the clothing she crafted  even though she herself had once walked among them.<br>And then... there are those little garments, one after another...<br><br>Throughout the years, they grow up alongside her, sharing songs of past times and dreams of the future<br> Only after witnessing so much ugliness does she understand the true weight of those innocent words.<br><i>\"As a dressmaster of Okhema and priest of Mnestia, my duties align with yours.\"<br>\"But the price of salvation...\"<br>\"...is it like yours?\"<br>\"Just like <b>ours</b>.\"</i><br><br>In the most visible spot, a simple, unadorned priest's robe hangs. She frequently takes it out to clean and dust, always reminding herself of the vow she made to the deity.<br><i>\"Please forgive me, for the sake of the most beautiful creation in the world...\"</i><br>Long ago, at the moment she took hold of the Coreflame, she suddenly \"saw\" in the darkness a breathtaking vista she had never before encountered <br>In that golden future, there is no more strife, no more death."
        },
        {
            "_id": 4,
            "Story": "They say it is the Flame-Chase Journey. They also say it is a journey of loss.<br><br>She can faintly feel something precious slipping away from her, but she has no time to dwell on it  for the person walking ahead of her is bearing a loss far greater than her own.<br><i>\"I'll leave this place in your hands, Aglaea.\"<br>\"Make sure you do your best.\"<br>\"See you next time!\"</i><br>She never understands why their goodbyes always sound like that.<br>All that remains are the faint melodies echoing from the depths of the sea, footprints swept away by the wind across the land, and an unsolvable chessboard left behind.<br><br><i>\"How can delicate threads bear the heavy weight of fate?\"</i><br>Her only companion is the Garmentmaker, yet her once grand wardrobe is now eerily empty.<br>The noble lady enters the political fray, sparking lively debates among the Council of Elders. Amid the continual sneers of bystanders, she begins to devise her plans.<br>The golden threads at her fingertips weave a net across Okhema. The nymphs rest in the corners of the city, ensnaring every whisper and breath.<br><br>Even the golden threads turn lethal, tainted with the scent of blood for the first time."
        },
        {
            "_id": 5,
            "Story": "To this day, the divine loom spins relentlessly, with numerous Garmentmakers hovering in midair. No one knows why they dance or why they rest.<br><i>\"Garmentmaker, please head to the plaza. We have guests who have traveled from afar...\"</i><br><br>This scene had unfolded countless times before. In the past, she was always the one reaching out, and now, it was others who sought her.<br>At that moment, a young man in silver-white armor stands there, his youthful face marred by hatred and bloodstains.<br>The girl in the purple dress remains silent, leaving a trail of chilling death mingled with the deep fragrance of flowers wherever she goes.<br>A thief, as stealthy as a cat, vanishes from Okhema, but she dismisses it as merely a silly prank.<br>The girl, warm as a faint light, had once healed her scars.<br>And then there is the crown prince from the outlands, the proud scholar <br><i>\"If one thread isn't enough, then let a myriad of threads lift the sky...\"</i><br>She seeks out diverse threads of fate, intertwining them into a resilient net. This net would launch toward the Titans' Coreflames, rekindling it afresh in a new world.<br><i>\"The Chrysos Heirs will together weave a dazzlingly bright future.\"</i><br><br>During a brief pause, she steps up to the window, overlooking the bustling city of Okhema below.<br><i>\"Garmentmaker, brew me another cup of hot tea, please.\"</i><br>She shivers slightly, yet her heart is no longer stirred by the sorrows of the past.<br>Invisible golden threads spill from her fingertips, intertwining with the city-state's pulse and heartbeat, with the whisper of wind and patter of rain  all resonating under her touch, like inspiration conjured by the god of romance, pulsing with the promise of new life.<br>After deep thought, she carefully packs away the ornate garments she had crafted in her youth.<br><i>\"Even if, in the end, I must wear nothing but plain clothes...\"</i><br><br>Legend holds that every disciple of Mnestia devotes their entire life to crafting what they deem to be the \"ultimate beauty\" to present to their deity.<br>It's been a long time since she crafted beautiful garments.<br>Yet, she has never ceased weaving the threads of destiny."
        }
    ]
}

